import React from "react";
import logoBarra from '../Img/gato-normal.jpg';
import { Outlet, Link } from 'react-router-dom';

import '../Css/Boton-Nav.css';


function BarraNav(){
  return(
    <div className = 'contenedor'>
      <div>
        <img
          className = 'imagenBarra'
          src = {logoBarra}
          alt = 'Logo barra nav' />
        <label
          className='BotonCambioPag'>
          <Link to= "/" >Inicio</Link>
        </label>
        <label
          className='BotonCambioPag'>
          <Link to="../Pages/SobreMi.jsx">Sobre Mi</Link>
        </label>
        <label
          className='BotonCambioPag'>
          <Link to="../Pages/Contacto.jsx">Contacto</Link>
        </label>
        <label
          className='BotonCambioPag'>
          <Link to="/" >Ejemplo 4</Link>
        </label>
        <label
          className='BotonCambioPag'>
          <Link to="/" >Ejemplo 5</Link>
        </label>
      </div>
      <Outlet />
    </div>
  );
};

export default BarraNav;
